import "./homePage.css";
import { Link } from "react-router-dom";
import UnderAge from "./underAge/UnderAge";

function HomePage() {
  return (
    <div className="main">
      <h1 className="main-h1">Star Wars fanpage</h1>
      <div className="wrapper">
        <p className="main-p">Please verify your age: </p>

        <Link to="#">I declare, that I am 16 years or older</Link>
        <Link to="#">I am under 16 years of age</Link>
      </div>
    </div>
  );
}

export default HomePage;
